CREATE OR REPLACE VIEW public.unmark_event AS
 SELECT DISTINCT e."eventId",
    e.name,
    e.description,
    e.url,
    e."startDate",
    e."endDate",
    e.date,
    e.locked,
    e."eventColor",
    e.status,
    e."allDay",
    e.location,
    e."referenceId",
    e."recordType",
    e."createdAt",
    e."updatedAt",
    e.type,
    e.notify,
    e.total_expense,
    e.agenda,
    e."orgId",
    e."calendarId",
    jsonb_agg(DISTINCT o.*) AS organizers,
    jsonb_build_object('total', count(DISTINCT u.*), 'totalMale', count(DISTINCT u.*) FILTER (WHERE ((u.gender)::text = 'male'::text)), 'totalFemale', count(DISTINCT u.*) FILTER (WHERE ((u.gender)::text = 'female'::text)), 'totalFinished', count(DISTINCT u.*) FILTER (WHERE (((cu.status)::text = 'finished'::text) OR ((u."finalAcademicStatus")::text = 'finished'::text))), 'totalMarked', count(DISTINCT u.*) FILTER (WHERE ((p."attendanceStatus" IS NOT NULL) AND ((cu.status)::text = 'start'::text) AND ((u."finalAcademicStatus")::text = 'start'::text)))) AS participatestatistic,
    jsonb_agg(DISTINCT oe.*) AS "originEvents"
   FROM ((((((public.event e
     JOIN public.participant p ON ((p."eventId" = e."eventId")))
     LEFT JOIN public.calendar_user cu ON (((p."participantId")::text = (cu."participantId")::text)))
     LEFT JOIN public.organizer o ON ((o."eventId" = e."eventId")))
     LEFT JOIN public."user" u ON ((u."userId" = p."userId")))
     LEFT JOIN public.linked_events le ON ((e."eventId" = le."eventId")))
     LEFT JOIN public.event oe ON ((oe."eventId" = le."linkedEventId")))
  GROUP BY e."eventId"
 HAVING (count(*) FILTER (WHERE (((cu.status)::text = 'start'::text) AND ((u."finalAcademicStatus")::text = 'start'::text))) > count(*) FILTER (WHERE ((p."attendanceStatus" IS NOT NULL) AND ((cu.status)::text = 'start'::text) AND ((u."finalAcademicStatus")::text = 'start'::text))));


